import React from 'react';
import TodoItem from './TodoItem';

function Todo({ todos }) {
    return (
        <>
            {todos.map((todo) => (
                <TodoItem
                    todo={todo}
                    key={todo.id}
                />
            ))}
        </>
    );
}

export default Todo;
